import React from "react";
import Response from "./Response";

export default function RespostaSimulacao(props){
    return (
        <div className="RespostaSimulacao">
            <div className="RespostaSimulacaoHeader">
                <img className="moneyIcon" src="https://static.vecteezy.com/system/resources/previews/011/660/689/original/3d-money-icon-illustration-png.png"></img>
                <h1 className="SimulacoesTitle">SIMULAÇÕES</h1>
                <img className="moneyIcon" src="https://static.vecteezy.com/system/resources/previews/011/660/689/original/3d-money-icon-illustration-png.png"></img>
            </div>
            <Response></Response>
        </div>
    )
}
